import '../App.css';

import React, {Component} from 'react';
import SummonerProfiles from './OverviewProfiles';

const images =
    importAll(require.context('./images/champion_squares', false, /\.(png)$/));

class Overview extends Component {
  constructor(props) {
    super();
  }

  render() {
    let d = this.props.data;
    var elements = [], bannedC = [];

    if (typeof (d) == 'object') {
      var bannedChamps = d['champions']['banned champions'];
      console.log(bannedChamps);
      var summoners = d['summoners']['sorted_summoners'];
      for (var i in summoners) {
        let dataToPass = {summoner: d['summoners'][summoners[i]]};
        elements.push(<SummonerProfiles data = {
          dataToPass
        } />);

        for(var c in bannedChamps.slice(0,5)){
            console.log(bannedChamps[c]);
            bannedC.push(<img className = 'OchampsPBpic' src= {bannedChamps[c][0] + '.png'}></img>)
      }
    }
  }



    return (<div className='dataContainer'><div className='OchampsPB'> Most Banned Champions<br></br>{bannedC}
            </div>
            <div className = 'OchampsPB'>Most Picked Champions<br></br>,
            </div>{elements}</div>)
      }
    }


    export default Overview;
